function Grille (aCle, aGenre, aNom, aRenvois) {
  this.cleGrille  = aCle;
  this.genre      = aGenre;
  this.nomFichier = aNom;
  this.renvois    = aRenvois;
}
function Renvois (aTitre, aLignes, aPolice) {
  this.titre  = aTitre;
  this.lignes = aLignes;
  this.police = aPolice;
}
function Lignes (aNumero, aTexte) {
  this.numero = aNumero;
  this.texte  = aTexte;
}
function Font (aNom, aTaille) {
  this.nom = aNom;
  this.taille = aTaille;
}
